import Facebook from "../assets/facebook.svg";
import twitter from "../assets/twitter.svg";
import {instagram} from "../assets/instagram.svg";

const socials = [
    {
        id: 0,
        name: "Facebook",
        src: Facebook,
        width: "9",
        height: "16",
    },
    {
        id: 1,
        name: "Twitter",
        src: twitter,
        width: "18",
        height: "16",
    },
    {
        id: 2,
        name: "Instagram",
        src: instagram,
        width: "18",
        height: "18",
    }
];

export default socials;
